import React,{Component} from 'react';
import Menu1 from './Menu1';
import "../../node_modules/video-react/dist/video-react.css";
import '../Css/Anaesthesia.css';
import Bottom from './Bottom';
import { Player } from 'video-react';
import axios from 'axios';
var images = require.context('../Backened/ADMIN_WALLET/ayurvedic/urology', true);

const Exercise = props => (
   <tr>
     <td>
          <div className="ka">  
     <Player className="skol"  fluid={false}
         width={750} height={400}
         playsInline    poster="/assets/poster.png" 
         src={images(`./${props.exercise.imagename}`)}/>
         <br/>
         <br/>
         <hr noshade width="100%"/> 
         </div>
      </td>
  </tr> 
)

export default class AUR_Urology extends Component 
{
  constructor(props) {
    super(props);
    this.state = {exercises: []};
                }
                componentDidMount() 
  {
    axios.get('http://localhost:5000/get/ayurvedic/urology')
      .then(response => {
        this.setState({ exercises: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }
  onSub()
  {
    window.location=('/Avedic');
  }
  exerciseList() {
    return this.state.exercises.map(currentexercise => {
      return <Exercise exercise={currentexercise} key={currentexercise._id}/>;
    })
  }
    render(){
  return (
     <div >  
       <Menu1/>
       <br/>
       <br/>
       <br/>
       <h1 className="kok">Urology<span align="right"><button onClick={this.onSub}>BACK</button></span></h1>
    <br/>
    <br/>
    <table id="customers" align="center">
          <tbody>
            { this.exerciseList() }
          </tbody>
    </table>
    <br/>
    <br/>
<Bottom/>
    </div>
      )
}
}
